import React from 'react'
import {Routes, Route, BrowserRouter, NavLink} from 'react-router-dom'
import Inicio from '../components/Inicio'

const MisRutas = () => {
    return (
        <BrowserRouter>
        {/*HEADER Y NAVEGACION*/}
        <HeaderNav/>
        {/*  CONTENIDO CENTRLA */}
                <Routes>
                    <Route path='/' element={<Inicio />} />

                </Routes>
            
            </BrowserRouter>
    )
}

export default MisRutas
